import{_ as a,c as t,a2 as i,o as r}from"./chunks/framework.ek9jOonm.js";const l="/study-everyday/assets/english-listening.mlfa2qsG.png",u=JSON.parse('{"title":"1009 今日总结","description":"","frontmatter":{},"headers":[],"relativePath":"record-2023/10/1009.md","filePath":"record-2023/10/1009.md"}'),s={name:"record-2023/10/1009.md"};function n(o,e,h,p,c,d){return r(),t("div",null,e[0]||(e[0]=[i(`<h1 id="_1009-今日总结" tabindex="-1">1009 今日总结 <a class="header-anchor" href="#_1009-今日总结" aria-label="Permalink to &quot;1009 今日总结&quot;">​</a></h1><p><img src="http://h2.ioliu.cn/bing/FremontPetroglyph_ZH-CN5736573545_1920x1080.jpg" alt=""></p><p><strong>关键词：</strong> Chrome下载PDF、React类型@types、组建系统、项目重构、英语听力练习、中年失业、双拼打字</p><h2 id="今日工作" tabindex="-1">今日工作 <a class="header-anchor" href="#今日工作" aria-label="Permalink to &quot;今日工作&quot;">​</a></h2><blockquote><p>问题，原因，解决方式，优化，巧妙实现，新知识</p></blockquote><h3 id="问题1-chrome-默认打开-pdf-文件而非下载-问题" tabindex="-1">问题1 Chrome 默认打开 pdf 文件而非下载 问题 <a class="header-anchor" href="#问题1-chrome-默认打开-pdf-文件而非下载-问题" aria-label="Permalink to &quot;问题1 Chrome 默认打开 pdf 文件而非下载 问题&quot;">​</a></h3><p><strong>需求：</strong> 请求接口，后端返回一个 url，通过 url 下载 pdf；</p><p><strong>问题：</strong> Chrome 的设置问题，对于 pdf 文件，默认处理方式是打开文件；</p><p><strong>处理方式：</strong></p><ul><li>需求协商：默认新 tab 页打开预览，如需下载，用户自己可以下载；</li><li>使用 url 下载：需要修改 后端返回的内容为 <strong>流</strong>，而非 一个 url；同时前端需要接受流的方式处理；</li></ul><p><strong>拓展：</strong></p><p>一般而言，对于下载文件的情况，是 2 种方式：</p><ul><li><code>window.open</code></li><li><code>&lt;a href=&quot;url&quot; /&gt;</code></li></ul><p>参考资料：</p><ul><li><a href="https://www.jianshu.com/p/03889f351718" target="_blank" rel="noreferrer">使用javascript下载pdf,浏览器打开预览pdf格式 - 简书</a></li></ul><h3 id="问题2-不同版本-react-types-类型和依赖的-类型不匹配问题" tabindex="-1">问题2 不同版本 React types 类型和依赖的 类型不匹配问题 <a class="header-anchor" href="#问题2-不同版本-react-types-类型和依赖的-类型不匹配问题" aria-label="Permalink to &quot;问题2 不同版本 React types 类型和依赖的 类型不匹配问题&quot;">​</a></h3><p>下班前，查看项目代码的时候，发现之前修改的代码类型报错了；原因是：</p><ul><li>组件代码中 React 使用版本是 <code>^16.x.x</code>，但是实际安装的 <code>@types/react</code> 版本是最新的 <code>^18.0.2</code>；</li><li>组件引入了 antd 组件，组件的 <code>key</code> 属性中，类型定义是用的 <code>@types/react: ^16.x.x</code>；</li><li>即：对于 <code>React.Key</code> 这个类型，在 低版本的 <code>React</code> 类型和 高版本的 <code>React</code> 类型不对应：</li></ul><div class="language-ts vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang">ts</span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">// React -&gt; v16.x.x</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">React.Key </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> string </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">|</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> number </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">|</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> null</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> |</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> undefined</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">;</span></span>
<span class="line"></span>
<span class="line"><span style="--shiki-light:#6A737D;--shiki-dark:#6A737D;">// React -&gt; v18.0.2</span></span>
<span class="line"><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;">React.Key </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">=</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> string </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">|</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> number </span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;">|</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> null</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> |</span><span style="--shiki-light:#005CC5;--shiki-dark:#79B8FF;"> undefined</span><span style="--shiki-light:#D73A49;--shiki-dark:#F97583;"> |</span><span style="--shiki-light:#24292E;--shiki-dark:#E1E4E8;"> bigint;</span></span></code></pre></div><p>搜索资料，AntD 也遇到了这个问题，可以看这个更新 <a href="https://github.com/ant-design/ant-design/pull/44938" target="_blank" rel="noreferrer">修复 @types/react@18.2.22 React.Key 定义更新引发的问题。#44938</a>，它 的处理方式是替换 <code>React.Key</code>， 使用其他类型：<code>InternalNamePath | string | string[]</code> 等</p><p>搜索资料过程中，发现一个类型自动安装的工具：<a href="https://github.com/jeffijoe/typesync" target="_blank" rel="noreferrer">jeffijoe/typesync</a> 可以自动安装所有 <code>@types/xxx</code></p><div class="warning custom-block"><p class="custom-block-title">补充</p><p>React 不同版本的类型差异，不仅仅会有这个 <code>React.Key</code> 不一致问题，其他的，之前整理组件时，遇到 <code>react-router-dom</code> 不同版本类型中对于 <code>React.Element</code> 类型也存在一定差异；</p></div><p>相关资料：</p><ul><li><a href="https://www.saoniuhuo.com/question/detail-2433652.html" target="_blank" rel="noreferrer">reactjs 如果@types/react和react有不同的版本会有问题吗？ _大数据知识库</a></li><li><a href="https://github.com/jeffijoe/typesync" target="_blank" rel="noreferrer">jeffijoe/typesync: Install missing TypeScript typings for dependencies in your package.json.</a></li></ul><h2 id="好文推荐" tabindex="-1">好文推荐 <a class="header-anchor" href="#好文推荐" aria-label="Permalink to &quot;好文推荐&quot;">​</a></h2><blockquote><p>有感好文，专题好文</p></blockquote><h3 id="top3" tabindex="-1">TOP3 <a class="header-anchor" href="#top3" aria-label="Permalink to &quot;TOP3&quot;">​</a></h3><ul><li><a href="https://juejin.cn/post/6844904068431740936" target="_blank" rel="noreferrer">从0到1教你搭建前端团队的组件系统（高级进阶必备） - 掘金</a> 使用father 工具搭建 ui 组件库，系统全面，千赞好文；</li><li><a href="https://juejin.cn/post/7282951856513843241" target="_blank" rel="noreferrer">七年前端，四年远程/上海搬家12次/在微软和硅谷远程 Offer 面前，我选择了后者 - 掘金</a> 电鸭社区分享的一位远程工作的开发经历和心得；</li><li><a href="https://github.com/a1029563229/blogs/blob/master/BestPractices/qiankun/Start.md" target="_blank" rel="noreferrer">基于 qiankun 的微前端最佳实践（万字长文）</a> 微前端好文！</li></ul><h3 id="英文" tabindex="-1">英文 <a class="header-anchor" href="#英文" aria-label="Permalink to &quot;英文&quot;">​</a></h3><p><img src="`+l+'" alt=""></p><ul><li><a href="https://juejin.cn/post/6844903860692058126" target="_blank" rel="noreferrer">程序员练英语听力的那些日子 - 掘金</a> 作者详细介绍了自己是如何练习英语听力的：听懂发音-精听-泛听</li></ul><h3 id="其他好文" tabindex="-1">其他好文 <a class="header-anchor" href="#其他好文" aria-label="Permalink to &quot;其他好文&quot;">​</a></h3><ul><li><a href="https://juejin.cn/post/7204471695544369207" target="_blank" rel="noreferrer">前端项目重构的一些思考和复盘 - 掘金</a></li><li><a href="https://www.docz.site/" target="_blank" rel="noreferrer">结合 father 搭建项目，文档使用 Docz</a> 前面有文章介绍了 ui 组件库搭建，这里学习 docz 文档工具的使用；</li><li><a href="https://juejin.cn/post/7260526125847838757#heading-21" target="_blank" rel="noreferrer">【23-07】最新从0-1搭建 react 18 + antd 5 + vite 4.4 + typescript 5 + husky 企业级项目详细流程 - 掘金</a></li></ul><h3 id="失业专题" tabindex="-1">失业专题 <a class="header-anchor" href="#失业专题" aria-label="Permalink to &quot;失业专题&quot;">​</a></h3><p>今年的寒气，上半年我就已经亲身感受到了，现在社区文章、B 站、小红书、抖音 越来越多类似的推送了；不禁感慨，人到中年，没有工作，背负着房贷、车贷、娃和家庭；步履维艰！</p><p>人到中年，到底该何去何从？看到社区大部分失业开发人员的几个去向：</p><ul><li>外卖、滴滴、货拉拉；</li><li>摆摊、开店（餐饮居多）；</li><li>创业（外包软件）；</li><li>远程开发：Web3 领域等新兴岗位；</li></ul><div class="tip custom-block"><p class="custom-block-title">感想</p><p>看了这么多中年失业的案例，不禁愈发焦虑。</p><p>转眼间，我也马上 30 岁了，站在这个职业转折点上，与其担心，不如 提前规划布局，居安思危，想好退路。</p></div><p><strong>文章</strong>：</p><ul><li><a href="https://www.v2ex.com/t/980089#reply32" target="_blank" rel="noreferrer">失业半年了 - V2EX</a></li><li><a href="https://www.v2ex.com/t/956789" target="_blank" rel="noreferrer">失业 | 第三弹：从外卖转到代驾 - V2EX</a></li><li><a href="https://juejin.cn/post/7287020579831267362" target="_blank" rel="noreferrer">也谈一下 30+ 程序员的出路 - 掘金</a></li></ul><h2 id="项目-博客推荐" tabindex="-1">项目/博客推荐 <a class="header-anchor" href="#项目-博客推荐" aria-label="Permalink to &quot;项目/博客推荐&quot;">​</a></h2><blockquote><p>值得学习 作者/项目/工具等</p></blockquote><h3 id="博客" tabindex="-1">博客 <a class="header-anchor" href="#博客" aria-label="Permalink to &quot;博客&quot;">​</a></h3><ul><li><a href="https://www.yuque.com/ideal-20/thought/bqw6gkidwzdr3tzd" target="_blank" rel="noreferrer">基于语雀的数据表格 | 2023 个人核心 OKR</a> 优秀的后端开发，这个个人 OKR 值得参考；下文可以进一步了解这位博主，勤奋且优秀；</li><li><a href="https://www.yuque.com/ideal-20/thought/gglg96vg1krzwuo4" target="_blank" rel="noreferrer">二十三岁的小行迹，愿与理想同行（2022年终总结）</a></li></ul><h3 id="项目" tabindex="-1">项目 <a class="header-anchor" href="#项目" aria-label="Permalink to &quot;项目&quot;">​</a></h3><ul><li><a href="https://github.com/Pursue-LLL/vite-react-fulllint-template" target="_blank" rel="noreferrer">vite-react-fulllint-template: vite4.4 + react 18 + ts5 template： pnpm、husky、eslint、stylelint、 commitizen、lint-staged、staged、prettier</a> 如题，一个 基于 vite 的 react + antd 开发模板；</li><li><a href="https://www.easyspider.cn/" target="_blank" rel="noreferrer">易采集EasySpider：无代码可视化爬虫软件</a> 很优秀的爬虫软件，不用写代码，可以认为是爬虫界的低代码工具，更关键的是，居然免费！！！</li></ul><h3 id="工具" tabindex="-1">工具 <a class="header-anchor" href="#工具" aria-label="Permalink to &quot;工具&quot;">​</a></h3><p>工作几年了，使用的还是拼音打字，准确率和效率其实一般般；</p><p>想学五笔打字，但是背词根之类的很头大；</p><p>折中方案：双拼，比拼音打字快，比五笔打字记忆少；可以快速学习起来；</p><ul><li><a href="https://zhuanlan.zhihu.com/p/32977956" target="_blank" rel="noreferrer">我做了一个双拼练习平台，想让高效的双拼输入法不再小众 - 知乎</a></li><li><a href="https://api.ihint.me/shuang/" target="_blank" rel="noreferrer">双拼练习 @ BlueSky</a></li></ul>',51)]))}const g=a(s,[["render",n]]);export{u as __pageData,g as default};
